The accessibility of data will be made clear through the inclusion of a reference with each source used.  The reference will be complete so that others will be able to find the source.  The dataset will be reported with Data Name, Data Value (i.e., type of value), Data Units, and Reference (or Calculated, where appropriate).  Preference is for secondary data sources that are freely available, although the existing calculations of material flows for MSW treatment technologies in the Facts and Figures report include data which are not normally public information.  Unfortunately, the reliability of data that is not freely available (through literature sources, for example) also draws into question the bias that may be present.  Efforts will be made to track the original source of data reported in the literature, and when data underpinning values used in the analyses are not trackable that fact will be reported (along with the reference).  

A data quality evaluation revealing that quality indicators (e.g., the geography, technology, or time represented for a process) are not matches with U.S. boundaries, exact process setups, or year of interest will not necessarily lead to not using data.  Such data might be the best available.  Evaluations will have to be made to most nearly meet the desires of boundaries, process setup, time, and other circumstances of representativeness.
